import video from '../images/video.mp4'

const VideoSection = () => {
    return ( 
        <div className="video__wrapper">
            <section className="video__section">
                <video autoPlay muted loop preload="auto" playsinline src={video}></video>
            </section>
        </div>
     );
}

export default VideoSection;
